import { line } from 'd3';

export const Marks = ({
  binnedData,
  xScale,
  yScale,
  tooltipFormat,
  innerHeight
}) => {
  console.log("Binned Data:", binnedData); // Debugging line to check data

  // Check if binnedData has any data
  if (binnedData.length === 0) {
    return null; // or a placeholder for no data
  }

  // Create a line generator
  const lineGenerator = line()
    .x(d => xScale(d.x0 + (d.x1 - d.x0) / 2)) // Midpoint between x0 and x1
    .y(d => yScale(d.y));

  return (
    <path
      className="line"
      d={lineGenerator(binnedData)}
      fill="none"
      stroke="steelblue"
      strokeWidth="2"
    />
  );
};
